import React, { useEffect } from "react";
import store from "store";


export default props => {
  useEffect(async () => {
    const token = store.get("token");
    if (!token) {
      props.history.push("/login");
    } else {
        store.remove("token");
        return <Redirect to="/login" />;;
    }
  }, []);
  return <div />;
};
